CREATE TABLE `tb_semu_match` (
  `idx` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `semu_idx` int(11) DEFAULT NULL COMMENT '세무요청IDX',
  `semusa_idx` int(11) DEFAULT NULL COMMENT '세무회원idx',
  `member_idx` int(11) DEFAULT NULL COMMENT '회원 idx',
  `estimate` varchar(50) DEFAULT NULL COMMENT '견적가',
  `bulbok` varchar(255) DEFAULT NULL COMMENT '불복내용',
  `goji` varchar(255) DEFAULT NULL COMMENT '고지내용',
  `charge_before` varchar(250) DEFAULT NULL COMMENT '착수금',
  `charge_center` varchar(250) DEFAULT NULL COMMENT '중도금',
  `charge_after` varchar(250) DEFAULT NULL COMMENT '성공액',
  `pyunggajasan` varchar(255) DEFAULT NULL COMMENT '평가대상 자산',
  `pyunggadate` varchar(50) DEFAULT NULL COMMENT '평가기준일',
  `pyungga_submission_date` varchar(50) DEFAULT NULL COMMENT '평가보고 제출일',
  `gamsidaesang` varchar(255) DEFAULT NULL COMMENT '감시대상',
  `gamsiowner` varchar(50) DEFAULT NULL COMMENT ' 감시책임자',
  `jigubdate` varchar(255) DEFAULT NULL COMMENT '용역비 지급시기',
  `contents` text COMMENT '맞춤소개',
  `cre_date` datetime DEFAULT NULL COMMENT '생성일',
  `mod_date` datetime DEFAULT NULL COMMENT '수정일',
  `semusa_status` char(1) DEFAULT 'A' COMMENT 'A:견적발송 B:견적완료C:견적반려',
  `match_status` char(1) NOT NULL DEFAULT 'A' COMMENT 'A:대기 B:발송',
  PRIMARY KEY (`idx`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

